import{_ as s,c as a,o as i,al as t}from"./chunks/framework.BG_RlZPd.js";const e="/assets/01.D4Znrd__.png",n="/assets/02.DH2va_mb.png",l="/assets/03.CB4peDrI.jpg",o="data:image/jpeg;base64,",p="/assets/05.Bhm7ztgF.png",h="/assets/06.fx9jzUjV.png",r="/assets/07.BCqltQLq.png",c="/assets/08.1rx9WYH6.png",d="/assets/09.DxLgF37B.png",j=JSON.parse('{"title":"DataGrip 2025.1 激活教程","description":"","frontmatter":{"title":"DataGrip 2025.1 激活教程","date":"2025-07-22","category":"软件","tags":["datagrip"],"abstract":"DataGrip是一款Jetbrains发布的数据库管理可视化工具。本文是 2025.1 版本的激活教程。"},"headers":[],"relativePath":"posts/activation-for-datagrip-2005-1/index.md","filePath":"posts/activation-for-datagrip-2005-1/index.md"}'),I={name:"posts/activation-for-datagrip-2005-1/index.md"};function g(B,A,E,C,m,Q){return i(),a("div",null,A[0]||(A[0]=[t('<h1 id="datagrip-2025-1-激活教程" tabindex="-1">DataGrip 2025.1 激活教程 <a class="header-anchor" href="#datagrip-2025-1-激活教程" aria-label="Permalink to &quot;DataGrip 2025.1 激活教程&quot;">​</a></h1><h2 id="第一步-解压工具包" tabindex="-1">第一步：解压工具包 <a class="header-anchor" href="#第一步-解压工具包" aria-label="Permalink to &quot;第一步：解压工具包&quot;">​</a></h2><p>工具<a href="https://pan.baidu.com/s/1JCZPTfXikYeeeSBjCjAZvg?pwd=4514" target="_blank" rel="noreferrer">下载</a>后，解压 zip 破解工具包（Windows 用户打开文件的后缀名，否则提示无法找到文件）。文件解压后如下几个主要文件：</p><p><img src="'+e+'" alt="01"></p><h2 id="第二步-添加配置激活工具路径" tabindex="-1">第二步：添加配置激活工具路径 <a class="header-anchor" href="#第二步-添加配置激活工具路径" aria-label="Permalink to &quot;第二步：添加配置激活工具路径&quot;">​</a></h2><p>添加激活工具路径信息，通过执行激活工具 scripts 目录下的脚本，自动添加。</p><p>激活工具下，scripts 目录中是脚本文件，进入到该目录下，可以看到多个脚本文件：</p><p><img src="'+n+'" alt="02"></p><h3 id="windows-用户" tabindex="-1">Windows 用户 <a class="header-anchor" href="#windows-用户" aria-label="Permalink to &quot;Windows 用户&quot;">​</a></h3><p>Windows 用户操作比较简单，直接双击执行 <code>install-current-user.vbs</code> 脚本文件，为当前用户激活使用工具（该操作会在 电脑环境变量 → 用户变量 下添加所有 JB 家族 IDE 的参数配置信息），如果安装有 360 安全软件会提示权限不足或者提示有风险，可以退出安全软件或者同意即可。</p><p>双击脚本之后，会弹窗提示，点击确定。如下：</p><p><img src="'+l+'" alt="03"></p><p>点击【OK】确定，执行过程中，需要大概 10-30 秒时间（也可能需要几分钟，时间不固定）。看到提示【Done】时，继续下面的步骤。</p><p><img src="'+o+'" alt="04"></p><h3 id="mac-linux-用户" tabindex="-1">Mac/Linux 用户 <a class="header-anchor" href="#mac-linux-用户" aria-label="Permalink to &quot;Mac/Linux 用户&quot;">​</a></h3><p>Mac 和 Linux 用户打开电脑终端，需要在终端下切换到激活工具 scripts 路径下，执行安装脚本 <code>install.sh</code>，如下：</p><p><img src="'+p+'" alt="05"></p><p>执行如下命令（因修改环境变量，需要输入电脑开机密码确认）：</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">$</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> sudo</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> bash</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> install.sh</span></span></code></pre></div><p><img src="'+h+`" alt="06"></p><p>出现如上图信息，表示执行完成。如果提示“Operation not permitted while System Integrity Protection is engaged”，请先赋权：</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">$</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> chmod</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> 755</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> install.sh</span></span></code></pre></div><p>再重新执行：</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">$</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> sudo</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> bash</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> install.sh</span></span>
<span class="line"></span>
<span class="line"><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;"># 或者直接执行脚本</span></span>
<span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">$</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> ./install.sh</span></span></code></pre></div><h2 id="第三步-重启-ide-或电脑" tabindex="-1">第三步：重启 IDE 或电脑 <a class="header-anchor" href="#第三步-重启-ide-或电脑" aria-label="Permalink to &quot;第三步：重启 IDE 或电脑&quot;">​</a></h2><p>保证第二步执行成功之后，需重启 IDE。Mac 和 Linux 用户需要重启电脑，才能保证工具生效。</p><div class="danger custom-block"><p class="custom-block-title">注意</p><p>执行完脚本工具，不要随便移动激活工具的位置，否则会造成 IDE 无法启动。如果不想用了，先执行破解的卸载脚本 <code>sudo bash uninstall.sh</code>，然后再删除工具并重启电脑即可。</p></div><h2 id="第四步-输入激活码" tabindex="-1">第四步：输入激活码 <a class="header-anchor" href="#第四步-输入激活码" aria-label="Permalink to &quot;第四步：输入激活码&quot;">​</a></h2><p>打开 IDE，选择【Activation Code】，添加<a href="./jets.idejihuo.com/v3/">专属永久激活码</a>，根据自己的 IDE 选择对应激活码。</p><p><img src="`+r+'" alt="06"></p><details class="details custom-block"><summary>DataGrip 激活码</summary><p>54H0PAD972IO7OS---</p></details><p><img src="'+c+'" alt="08"></p><p>成功激活！不用在意激活的时间，已经永久激活。</p><p><img src="'+d+'" alt="09"></p><p><a href="https://blog.idejihuo.com/jetbrains/the-latest-activation-tutorial-for-datagrip-2025-1-permanent-activation-code.html" target="_blank" rel="noreferrer">原文地址</a></p>',35)]))}const k=s(I,[["render",g]]);export{j as __pageData,k as default};
